import React from 'react';
import { Switch,Route } from 'react-router-dom';

import Shop from "./Pages/ShopPage";
import Home from "./Pages/HomePage";
import BuyerLogin from "./Pages/BuyerLogin";
import Seller from "./Pages/SellerLogin";
import SignUp from "./Pages/SignUp";
// import Profile from "./profile/Profile.js";
// import PatNolPat from "./404/404.js";

const MainRoute = () => {
    return(
        <Switch>
            <Route exact path = "/" component = {Home}/>
            <Route exact path = "/store" component = {Shop}/>
            <Route exact path = "/signin/buyer" component = {BuyerLogin}/>
            <Route exact path = "/signin/seller" component = {Seller}/>
            <Route exact path = "/signup" component = {SignUp}/>
            {/* <Route exact path = "/profile" component = {Profile}/> */}
            {/* <Route exact path = "/city-page" component = {City}/> */}
            {/* <Route exact path = "/mood-page" component = {Mood}/> */}
            {/* <Route component = {PatNolPat}/> */}
        </Switch>
    )
}

export default MainRoute;
